import React, {useEffect} from 'react';
import './App.css';

function App() {
  useEffect(() => {
    fetch("http://127.0.0.1:5000/?question=4&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(res => res.text()).then(text => {
      console.log(text);
    });
  }, [])
  return <div className="App"/>;
}

export default App;
